import React from 'react';


const SlotM = () => {
    let x = '@';
    let y = '@';
    let z = '4';

    if (x === y && y === z) {
        return (
            <div className='slot_inner'>
                <h1>
                    {x} {y} {z}
                </h1>
                <h1>This is matching</h1>
            </div>
        )
    }
    else{
        return (
            <div className='slot_inner'>
                <h1>
                    {x} {y} {z}
                </h1>
                <h1>They are not matching</h1>
            </div>
        )
    }
}

export default SlotM;
